import React, { useEffect, useState } from 'react';
import axios from 'axios';

const UserDashboard = () => {
  const [statusCounts, setStatusCounts] = useState({ inProgress: 0, closed: 0 });

  useEffect(() => {
    const fetchStatusCounts = async () => {
      try {
        const userId = 'userUserId'; // Replace with actual user ID
        const response = await axios.get(`/api/tickets/dashboard/user/${userId}`);
        setStatusCounts(response.data.statusCounts);
      } catch (error) {
        console.error('Error fetching status counts:', error);
      }
    };

    fetchStatusCounts();
  }, []);

  return (
    <div>
      <h1>User Dashboard</h1>
      <table>
        <thead>
          <tr>
            <th>Status</th>
            <th>Count</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>In Progress</td>
            <td>{statusCounts.inProgress}</td>
          </tr>
          <tr>
            <td>Closed</td>
            <td>{statusCounts.closed}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default UserDashboard;
